import React, { FC } from 'react'
import { ImageBackground, ImageResizeMode, ImageSourcePropType, Text, View } from 'react-native'
import styles from './styles'

interface IImageBackground{
  imageSource:ImageSourcePropType,
  resizeMode: ImageResizeMode
}

const CustomImageBackground:FC<IImageBackground> = ({imageSource,resizeMode}) => {
  return (
      <View style={styles.container}>

        <ImageBackground 
          source={imageSource} 
          resizeMode={resizeMode}
          style={styles.image}
          >
            <Text>sdfsdf</Text>
          </ImageBackground>
      </View>
  )
}

export default CustomImageBackground
